    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities from May through August of 1957.  The
    report begins with a summary of the weather and habitat conditions during this period.
     Qualitative and quantitative observations are documented for fish and wildlife-
    including migratory birds, upland game birds, big game animals, fur animals, predators,
    rodents, other mammals and other birds.  The report includes a refuge development
    and maintenance section which discusses physical development, plantings, collections
    and receipts of seed.   A section on resource management is included in the report.
     The public relations section of the report explains: recreational uses, refuge
    visitors, refuge participation, hunting and violations. The report also reviews
    other items of interest, includes a photograph and a map depicting refuge habitat
    units.  Narrative report forms for species and population information in the refuge
    are provided.  This report describes easement refuges for District 5-A, which include
    Lake Elsie and Storm Lake.",nt"license_title": "License Not Specified",nt"extras":
